import React from 'react';
import './App.css';
import Header from './components/Header/Header';
import Nav from './components/Nav/Nav';
import { Route, BrowserRouter } from "react-router-dom";
import Messages from './components/Article/Messages/Messages';
import Profile from './components/Article/Profile/Profile';
import News from './components/Article/News/News';
import Friends from './components/Article/Friends/Friends';
import Settings from './components/Article/Settings/Settings';


const App = (props) => {
  return (
    <BrowserRouter>
      <div className="app-wrap">
        <Header />
        <Nav navState={props.state.navbar}/>
        <article className="article">

          <Route path="/profile" render={ () => <Profile profileState={props.state.profilePage} addPost={props.addPost} /> } />
          <Route path="/messages"
          render={ () => <Messages messagesState={props.state.dialogsPage } />} />
          <Route path="/news" render={ () => <News/>} />
          <Route path="/friends" render={ () => <Friends/>} />
          <Route path="/settings" render={ () => <Settings/>} />

        </article>
      </div>
    </BrowserRouter>
  );
}


export default App;

